import {useEffect, useState} from "react";
import OrderService from "../../../../services/orderServices/OrderService";
import Toast from "../../../../components/toast-message/ToastMessage";
import CustomTable from "../../../../components/custom-table/CustomTable";

function CompletedOrders() {
    const [completedOrder, setCompletedOrder] = useState([]);

    const getNewOrder = async () => {
        try {
            const response = await OrderService.getOrderList("COMPLETED");
            if (response.success) {
                setCompletedOrder(response.data);
            } else {
                Toast.error(response.message);
            }
        } catch (error) {
            Toast.error(error);
        }
    };

    useEffect(() => {
        getNewOrder();
    }, []);

    useEffect(() => {}, [completedOrder]);

    return (
        <>
            <div className="card-header">
            </div>
            <div className="card-body">
                {completedOrder && (
                    <CustomTable data={completedOrder} endpoint={'cms/orders/new-order'} />
                )}
            </div>
        </>
    );
}

export default CompletedOrders;
